import "./App.css";
import "./Page2.css";

function App() {
  return (
    <div className="app">
      <div className="bg">
        <span>
          <span className="headtext">UPBEAT</span>
        </span>
        <div class="text">
          <a href="/page2" className="textlink">
            CLICK ON HERE TO START
          </a>
        </div>
        <div>
          <button className="startButton" a href="/page2">
            Start
          </button>
        </div>
      </div>
    </div>
  );
}

export default App;
